import React from "react";
import { motion } from "framer-motion";

export default function Planes() {
  return (
    <section className="min-h-screen bg-[#0a0f1a] text-white font-[Poppins] overflow-hidden">
      {/* ðŸŒŸ Hero */}
      <div className="text-center py-20 bg-gradient-to-b from-[#0a0f1a] via-[#0e1729] to-[#0a0f1a]">
        <motion.h1
          initial={{ opacity: 0, y: -50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-5xl md:text-6xl font-bold text-[#38bdf8] mb-6"
        >
          Planes a tu Medida
        </motion.h1>
        <motion.p
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ delay: 0.3, duration: 0.8 }}
          className="text-lg text-gray-300 max-w-3xl mx-auto"
        >
          Escoge el plan que mejor se adapte a las necesidades de tu empresa.
          Todos incluyen soporte tÃ©cnico, optimizaciÃ³n y seguridad constante.
        </motion.p>
      </div>

      {/* ðŸ’¼ Planes */}
      <div className="grid md:grid-cols-3 gap-8 px-6 md:px-16 py-20 max-w-7xl mx-auto">
        {[
          {
            nombre: "BÃ¡sico",
            precio: "$49.990",
            features: [
              "DiseÃ±o web estÃ¡ndar",
              "1 dominio incluido",
              "Hosting bÃ¡sico",
              "Soporte por email",
            ],
            color: "#38bdf8",
          },
          {
            nombre: "Profesional",
            precio: "$99.990",
            features: [
              "DiseÃ±o personalizado",
              "3 dominios incluidos",
              "Hosting profesional",
              "Soporte 24/7",
            ],
            color: "#0ea5e9",
            destacado: true,
          },
          {
            nombre: "Empresarial",
            precio: "$149.990",
            features: [
              "DiseÃ±o premium",
              "5 dominios incluidos",
              "Hosting avanzado",
              "Administrador dedicado",
            ],
            color: "#0284c7",
          },
        ].map((plan, index) => (
          <motion.div
            key={index}
            whileHover={{ scale: 1.05 }}
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: index * 0.2 }}
            className={`relative bg-[#111827]/80 border-2 rounded-2xl shadow-lg p-8 backdrop-blur-lg transition-all duration-300 ${
              plan.destacado
                ? "border-[#38bdf8] shadow-[#38bdf8]/40"
                : "border-gray-700"
            }`}
          >
            {plan.destacado && (
              <div className="absolute top-0 right-0 bg-[#38bdf8] text-black px-4 py-1 rounded-bl-2xl text-sm font-semibold">
                RECOMENDADO
              </div>
            )}
            <h3
              className="text-2xl font-semibold mb-4 text-center"
              style={{ color: plan.color }}
            >
              {plan.nombre}
            </h3>
            <p className="text-4xl font-bold text-center mb-6">{plan.precio}</p>
            <ul className="space-y-3 text-gray-300 mb-8">
              {plan.features.map((f, i) => (
                <li key={i} className="flex items-center gap-2">
                  <span className="text-[#38bdf8]">âœ”</span> {f}
                </li>
              ))}
            </ul>
            <button
              className="w-full py-3 rounded-lg font-semibold transition-all text-black bg-[#38bdf8] hover:bg-[#0ea5e9]"
              style={{ boxShadow: "0 0 20px #38bdf850" }}
            >
              Elegir Plan
            </button>
          </motion.div>
        ))}
      </div>

      {/* ðŸ“Š Tabla comparativa */}
      <div className="px-6 md:px-16 py-20 bg-[#0e1729]">
        <h2 className="text-center text-4xl font-bold text-[#38bdf8] mb-12">
          Comparativa de Planes
        </h2>
        <div className="overflow-x-auto rounded-2xl shadow-lg border border-[#1e293b]">
          <table className="min-w-full border-collapse bg-[#0a0f1a] text-sm md:text-base">
            <thead className="bg-[#111827] text-[#38bdf8] uppercase tracking-wide">
              <tr>
                <th className="py-4 px-4 text-left">CaracterÃ­sticas</th>
                <th className="py-4 px-4 text-center">BÃ¡sico</th>
                <th className="py-4 px-4 text-center text-[#38bdf8]">
                  Profesional
                </th>
                <th className="py-4 px-4 text-center">Empresarial</th>
              </tr>
            </thead>
            <tbody>
              {[
                ["DiseÃ±o Personalizado", "âŒ", "âœ…", "âœ…"],
                ["Dominios Incluidos", "1", "3", "5"],
                ["Hosting", "BÃ¡sico", "Profesional", "Avanzado"],
                ["Soporte TÃ©cnico", "Email", "24/7", "Dedicado"],
                ["Mantenimiento", "Mensual", "Semanal", "Diario"],
              ].map((fila, i) => (
                <motion.tr
                  key={i}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.4, delay: i * 0.15 }}
                  className={`border-t border-[#1e293b] hover:bg-[#1e293b]/50 transition-all duration-300`}
                >
                  {fila.map((col, j) => (
                    <td
                      key={j}
                      className={`py-4 px-4 text-center ${
                        j === 0 ? "text-left text-gray-300" : ""
                      }`}
                    >
                      {col}
                    </td>
                  ))}
                </motion.tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </section>
  );
}
